    <link rel="stylesheet" href="">
    <style>
      #github_cloud {
        animation: float_1 3s ease-in-out infinite;
	      transform: translatey(0px);
      }

      #open_source_horizon {
        animation: float_2 5s ease-in-out infinite;
	      transform: translatex(0px); 
      }

      #registrar_cloud {
        animation: float_3 5s ease-in-out infinite;
	      transform: translatex(0px); 
      }

      #digitalocean_cloud {
        animation: float_4 3s ease-in-out infinite;
	      transform: translatey(0px);
      }

      @keyframes float_1 {
        0% {
          transform: translatey(0px);
        }
        50% {
          transform: translatey(-5px);
        }
        100% {          
          transform: translatey(0px);
        }
      }

      @keyframes float_2 {
        0% {
          transform: translatex(0px);
        }
        50% {
          transform: translatex(-4px);
        }
        100% {          
          transform: translatex(0px);
        }
      }

      @keyframes float_3 {
        0% {
          transform: translatex(0px);
        }
        50% {
          transform: translatex(4px);
        }
        100% {          
          transform: translatex(0px);
        }
      }

      @keyframes float_4 {
        0% {
          transform: translatey(0px);
        }
        50% {
          transform: translatey(3px);
        }
        100% {          
          transform: translatey(0px);
        }
      }

    </style>
